import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
<h1>File Upload Service</h1>
<form>
  <input type='text' placeholder="Search for a Title.." name='search'></input>
  <button type='submit'></button><br/><br/>
  <h3>Upload a File</h3>
  <label>Title</label>
  <input name='title' type='text'></input>
  <label>Date</label>
  <input name='date' type='date'></input>
  <label>Reference</label>
  <input name='reference' type='text'></input><br/><br/>
  <label><b>Content Type:</b> </label>
  <label>Preach</label> 
  <input name='contentradio' type='radio' id='preach' value='preach'/>
  <label>Music</label> 
  <input name='contentradio' type='radio' id='music' value='music'/><br/><br/>
  <label>Speaker</label>
  <input name='speaker' type='text'></input><p/>
  <input name='comment' type='text'></input><p/>

</form>
    </div>
  );
}

export default App;
